import logo from "./logo.svg";
import "./home.css";
import { Link } from "react-router-dom";

function App() {
	return (
		<div className="App">
			<header className="App-header"></header>
			<nav>
				<ul>
					<li>
						<Link to="/">Home</Link>
					</li>
					<li>
						<Link to="/about">About</Link>
					</li>
					<li>
						<Link to="/blog">Blog</Link>
					</li>
					<li>
						<Link to="/signup">Sign Up</Link>
					</li>
					<li>
						<Link to="/login">Login</Link>
					</li>
				</ul>
			</nav>
		</div>
	);
}

export default App;
